import{_ as a}from"./chunks/position_fixed.t2m3lWVy.js";import{_ as e,c as t,o as _,ab as r}from"./chunks/framework.CUflZczI.js";const O=JSON.parse('{"title":"Режим зльоту (Мультикоптер)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_modes_mc/takeoff.md","filePath":"uk/flight_modes_mc/takeoff.md"}'),i={name:"uk/flight_modes_mc/takeoff.md"},l=r('<h1 id="режим-зльоту-мультикоптер" tabindex="-1">Режим зльоту (Мультикоптер) <a class="header-anchor" href="#режим-зльоту-мультикоптер" aria-label="Permalink to &quot;Режим зльоту (Мультикоптер)&quot;">​</a></h1><img src="'+a+'" title="Position fix required (e.g. GPS)" width="30px"><p>У режимі польоту <em>Зліт</em> транспортний засіб піднімається на задану висоту і чекає на подальші вказівки.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><ul><li>Режим є автоматичним - для керування транспортним засобом не потрібне <em>втручання</em> користувача.</li><li>Режим потребує принаймні дійсної локальної оцінки позиції (не потребує глобальної позиції). <ul><li>Літаючі апарати не можуть перемикатися в цей режим без дійсної локальної позиції.</li><li>Літаючі транспортні засоби перейдуть в режим аварійної безпеки, якщо втратять оцінку положення.</li><li>Роззброєні транспортні засоби можуть переключатися в режим без дійсної оцінки позиції, але не можуть озброюватися.</li></ul></li><li>Перемикачі керування RC можна використовувати для зміни режимів польоту.</li><li>Рух палиць дистанційного керування <a href="#COM_RC_OVERRIDE">за замовчуванням</a> змінить транспортний засіб на <a href="./../flight_modes_mc/position.html">режим позиції</a>, якщо не буде обробки критичного відключення батареї.</li><li><a href="./../config/safety.html#failure-detector">Детектор несправностей</a> автоматично зупинить мотори, якщо на зльоті виникне проблема.</li></ul></div><h2 id="технічнии-підсумок" tabindex="-1">Технічний підсумок <a class="header-anchor" href="#технічнии-підсумок" aria-label="Permalink to &quot;Технічний підсумок&quot;">​</a></h2><p>Багатовертольот вибуває вертикально на висоту, визначену в <a href="./../advanced_config/parameter_reference.html#MIS_TAKEOFF_ALT">MIS_TAKEOFF_ALT</a> і утримує позицію.</p><p>Рух палиці RC змінить транспортний засіб на <a href="./../flight_modes_mc/position.html">Режим положення</a> (за <a href="#COM_RC_OVERRIDE">за замовчуванням</a>).</p><h3 id="параметри" tabindex="-1">Параметри <a class="header-anchor" href="#параметри" aria-label="Permalink to &quot;Параметри&quot;">​</a></h3><p>Взліт впливається наступними параметрами:</p><table><thead><tr><th>Параметр</th><th>Опис</th></tr></thead><tbody><tr><td><a id="MIS_TAKEOFF_ALT"></a><a href="./../advanced_config/parameter_reference.html#MIS_TAKEOFF_ALT">MIS_TAKEOFF_ALT</a></td><td>Цільова висота під час злітання (типово: 2.5м)</td></tr><tr><td><a id="MPC_TKO_SPEED"></a><a href="./../advanced_config/parameter_reference.html#MPC_TKO_SPEED">MPC_TKO_SPEED</a></td><td>Швидкість підйому (за замовчуванням: 1.5м/с)</td></tr><tr><td><a id="COM_RC_OVERRIDE"></a><a href="./../advanced_config/parameter_reference.html#COM_RC_OVERRIDE">COM_RC_OVERRIDE</a></td><td>Контролює переміщення джойстика на мультикоптері (або конвертоплані у режимі MC) зміну режиму на <a href="./../flight_modes_mc/position.html">Режим положення</a>. Це можна окремо увімкнути для автоматичних режимів та для режиму поза бортом, і в автоматичних режимах воно включено за замовчуванням.</td></tr><tr><td><a id="COM_RC_STICK_OV"></a><a href="./../advanced_config/parameter_reference.html#COM_RC_STICK_OV">COM_RC_STICK_OV</a></td><td>Кількість рухів стиків, яка викликає перехід у режим <a href="./../flight_modes_mc/position.html">Положення</a> (якщо <a href="#COM_RC_OVERRIDE">COM_RC_OVERRIDE</a> увімкнено)</td></tr></tbody></table><h2 id="дивись-також" tabindex="-1">Дивись також <a class="header-anchor" href="#дивись-також" aria-label="Permalink to &quot;Дивись також&quot;">​</a></h2><ul><li><a href="./../flight_modes_mc/throw_launch.html">Запуск з катапульти чи підкиданням (MC)</a></li><li><a href="./../flight_modes_fw/takeoff.html">Злітній режим (FW)</a></li></ul>',12),o=[l];function d(h,f,c,m,n,s){return _(),t("div",null,o)}const u=e(i,[["render",d]]);export{O as __pageData,u as default};
